def find_primes_between_indices(integers):
    def is_prime(n):
        if n < 2:
            return False
        for i in range(2, int(n**0.5)+1):
            if n % i == 0:
                return False
        return True

    return sorted([i for i in integers[61:80] if is_prime(i)])
